I know people come to Instagram for escapism and fluff, but this is too important not to put into your feed once more. We cannot turn a blind eye to what is happening now. Call, vote, share, volunteer, and donate whenever possible. And if you need or would like a helpful primer to what is happening, consider reading the amazing resource guide @studiodiy created (studiodiy.com). Please check out some of the organizations below who are doing vital work:
